import React from 'react'
import './styles.css' ; 
import {Line} from 'react-chartjs-2' ; 
const App = () => {
    return (
        <Line 
        data = {{
            labels:["Abhi" , "UDK"] ,
            datasets:[
                {
                    data:['dweofer' , 'ferofnerif'] , 
                    label:['']
                }
            ]
        }}
        />
    )
}

export default App
